    return (





        <div style={{
            display: "flex",
            flex: 1,
            }}>
            <Header />
            <AddTodo />

            <p style={{
                backgroundColor: "grey" ,
                width: 1000,
            }} >This is user input</p>       

            <button style={{
                backgroundColor: "yellow",
            }}>
                Update
            </button>

            <button style={{
                backgroundColor: "Red",
            }}>
                Delete
            </button>

            <Todos />
        </div>
    )
}
